import React, { useState } from "react";
import { Nav, Image, Container, Navbar } from "react-bootstrap";

const NavbarHeader = () => {
  const [activeItem, setActiveItem] = useState(0);

  const handleItemClick = (index) => {
    setActiveItem(index);
  };

  return (
    <Navbar expand="lg" bg="transparent" variant="dark" className="custom-navbar">
      <Container>
        <Navbar.Brand>
          <Image
            src="https://avatars.githubusercontent.com/u/133301187?v=4"
            roundedCircle
            width={50}
            height={50}
          />
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="mx-auto custom-nav">
            {/* ... rest of your code ... */}
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

const ContentList = ({ icon, detail }) => {
  return (
    <>
      <i className={icon}></i> {detail}
    </>
  );
};

export default NavbarHeader;
